import React from 'react';
import styled from 'styled-components';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faUserPlus, faUserTimes, faMoneyBillWave, faMoneyCheckAlt, faWallet } from '@fortawesome/free-solid-svg-icons';

const NavbarContainer = styled.div`
  background-color: #004080;
  padding: 15px;
  color: white;
  display: flex;
  justify-content: space-around;
  align-items: center;
`;

const NavItem = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  cursor: pointer;

  &:hover {
    color: #a9c4eb;
  }
`;

const IconLabel = styled.span`
  margin-top: 5px;
  font-size: 12px;
`;

const Navbar = () => {
  return (
    <NavbarContainer>
      <NavItem>
        <FontAwesomeIcon icon={faUserPlus} size="2x" />
        <IconLabel>Create Account</IconLabel>
      </NavItem>
      <NavItem>
        <FontAwesomeIcon icon={faUserTimes} size="2x" />
        <IconLabel>Close Account</IconLabel>
      </NavItem>
      <NavItem>
        <FontAwesomeIcon icon={faMoneyBillWave} size="2x" />
        <IconLabel>Deposit Money</IconLabel>
      </NavItem>
      <NavItem>
        <FontAwesomeIcon icon={faMoneyCheckAlt} size="2x" />
        <IconLabel>Withdraw Money</IconLabel>
      </NavItem>
      <NavItem>
        <FontAwesomeIcon icon={faWallet} size="2x" />
        <IconLabel>Check Balance</IconLabel>
      </NavItem>
    </NavbarContainer>
  );
};

export default Navbar;
